import request from 'supertest';
import { expect } from 'chai';
import app from '../server.js';

describe('API Endpoints', () => {
  describe('POST /users', () => {
    it('should create a new user and return the user data', async () => {
      const userData = {
        email: 'bob@dylan.com',
        password: 'toto1234!'
      };

      const res = await request(app)
        .post('/users')
        .send(userData)
        .set('Content-Type', 'application/json');

      expect(res.status).to.equal(201); // Assuming 201 Created is the expected status code
      expect(res.body).to.be.an('object');
      expect(res.body).to.have.property('id');
      expect(res.body).to.have.property('email').that.equals(userData.email);
      expect(res.body.id).to.be.a('string');
    });
  });
});

